import './Controls.css'
import Button from '../UI/Button/Button'

const Controls = (props) => {

    const startHandler = () => {
        props.start
    }

    return (
        <div className='controls-container'>
            <Button onClick={startHandler}>Start</Button>
            <Button>Reset</Button>
        </div>
    )
}

export default Controls
